import { AboutMeBox } from "../contentBox/AboutMeBox";
import { SkillsBox } from "../contentBox/SkillsBox";

export function AboutMePage(){
  
    return (
        <div className='h-screen w-full bg-second flex flex-wrap md:flex-nowrap justify-center items-center'>
            <AboutMeBox />

            <div className="flex flex-col w-full justify-center items-center">
            <SkillsBox />
                <div className="flex flex-col">
                    <span className="color-main">EDUCATION</span>
                    <div className="flex flex-col py-4">
                        <span className="text-white">2018 - 2022</span>
                        <span className="text-white">Multimedia and Game Development</span>
                        <span className="text-white">King Mongkut's Institute of Technology Ladkrabang</span>
                    </div>
                </div>
            </div>
        </div>
      );
}
